  "text" : "\uC5D8\uC6E8\uC758 \uC740\uBC1C\uC744 \uB2EE\uC740 \uBBF8\uB9AC\uC5D8\uC744 \uC120\uD0DD\uD55C \uD540\uC6E8 \uC124\uC815\uC740 \uCC38 \uC88B\uC740\uAC70\uC2DC\uB2E4. \uADF8\uB798\uB3C4 \uD540\uC6E8\uB294 \uADF8 \uB098\uB984\uB300\uB85C\uB294 \uC0AC\uB791\uC774\uB77C\uACE0 \uC0DD\uAC01\uD588\uACA0\uC9C0. \uADF8\uB7EC\uB2E4 \uC7AC\uD63C \uC900\uBE44\uD558\uBA74\uC11C \uD398\uC544\uB178\uB974\uAC00 \uC774\uB7F4\uAC70\uBA74 \uBB50\uD558\uB7EC \uC5B4\uBA38\uB2C8\uB791 \uACB0\uD63C\uD558\uC168\uB0D0, \uB098\uB3C4 \uB0B3\uC9C0\uB9D0\uACE0 \uD63C\uC790 \uC0AC\uC2DC\uB2E4 \uC990\uAC81\uAC8C \uC9C0\uAE08 \uACB0\uD63C\uD558\uC2E4 \uAC83\uC774\uC9C0,",
