  "text" : "\uD398\uC544\uB178\uB974\uAC00 \uD540\uC6E8\uB97C \uC695\uB9DD\uD558\uAC8C \uB41C \uC2DC\uC791\uC740 \uC5ED\uC2DC \uC778\uB514\uC2A4\uC640\uC758 \uC7AC\uD63C\uC774 \uACC4\uAE30\uAC00  \uC544\uB2C8\uC5C8\uC744\uAE4C. \uC774\uC81C\uBD80\uD130 \uB534 \uC5EC\uC790\uB791 \uCE68\uC2DD\uC744 \uAC19\uC774 \uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB2C8 \uCC38\uC744 \uC218\uAC00 \uC5C6\uC5B4\uC84C\uB2E4\uAC70\uB098. \uD540\uC6E8\uC758 \uBAA8\uB4E0 \uAC83\uC5D0 \uC778\uB514\uC2A4\uC758 \uC190\uC774 \uB2FF\uACE0 \uC2DC\uC120\uC774 \uBA38\uBB3C\uB800\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB2C8 \uBBF8\uCE60 \uAC83 \uAC19\uACE0 \uBB50 \uC774\uB7F0\uAC70.",
